%[text] # Example script how to use PIVlab from the commandline
%[text] Just run this script to see what it does.
%[text] You can also adjust the settings in "s" and "p", specify a mask and a region of interest
clc; clear variables; close all
pivlab_dir = fileparts(which("buildfile.m"));
addpath(pivlab_dir); %add the PIVlab folder to search path
%[text] Select a number \> 1 if you want to use the parallel computing toolbox to perform parallel computing:
nr_of_cores = 1; % integer, 1 means single core, greater than 1 means parallel
%[text] ## Image files location:
image_root_dir = fullfile(pivlab_dir,'..','data_from_william','stereo_2'); %directory containing the images you want to analyze
image_dir = fullfile(image_root_dir, "PIV images1");
image_ext = 'tif'; % bmp / tif / jpg / tiff / jpeg
pairwise = true; % false for [A+B], [B+C], [C+D]... sequencing style, and true for [A+B], [C+D], [E+F]... sequencing style
%%
%[text] ## Calibration image settings and files
pattern_type = "charuco-board";
pattern_dims = [7 10];
pattern_name = "DICT_5X5_100";
checker_size = 8.8;  % 100 pixels / 300 pixels-per-inch * 26.4 mm-per-inch)
marker_size = 0.75 * checker_size;

calibration_dir = fullfile(image_root_dir,"moving board");
n_calibration_files = 5;
%%
%[text] ## Standard PIV Settings
s = cell(15,2); % To make it more readable, let's create a "settings table"
%Parameter                          %Setting			%Options
s{1,1}= 'Int. area 1';              s{1,2}=64;			% window size of first pass
s{2,1}= 'Step size 1';              s{2,2}=32;			% step of first pass
s{3,1}= 'Subpix. finder';           s{3,2}=1;			% 1 = 3point Gauss, 2 = 2D Gauss
s{4,1}= 'Mask';                     s{4,2}=[];			% If needed, supply a binary image mask with the same size as the PIV images
s{5,1}= 'ROI';                      s{5,2}=[];			% Region of interest: [x,y,width,height] in pixels, may be left empty to process the whole image
s{6,1}= 'Nr. of passes';            s{6,2}=2;			% 1-4 nr. of passes
s{7,1}= 'Int. area 2';              s{7,2}=32;			% second pass window size
s{8,1}= 'Int. area 3';              s{8,2}=16;			% third pass window size
s{9,1}= 'Int. area 4';              s{9,2}=16;			% fourth pass window size
s{10,1}='Window deformation';       s{10,2}='*linear';	% '*spline' is more accurate, but slower
s{11,1}='Repeated Correlation';     s{11,2}=0;			% 0 or 1 : Repeat the correlation four times and multiply the correlation matrices.
s{12,1}='Disable Autocorrelation';  s{12,2}=0;			% 0 or 1 : Disable Autocorrelation in the first pass.
s{13,1}='Correlation style';        s{13,2}=0;			% 0 or 1 : Use circular correlation (0) or linear correlation (1).
s{14,1}='Repeat last pass';			s{14,2}=0;			% 0 or 1 : Repeat the last pass of a multipass analyis
s{15,1}='Last pass quality slope';  s{15,2}=0.025;		% Repetitions of last pass will stop when the average difference to the previous pass is less than this number.
%%
%[text] ## Standard image preprocessing settings
p = cell(10,1);
%Parameter                       %Setting           %Options
p{1,1}= 'ROI';                   p{1,2}=s{5,2};     % same as in PIV settings
p{2,1}= 'CLAHE';                 p{2,2}=1;          % 1 = enable CLAHE (contrast enhancement), 0 = disable
p{3,1}= 'CLAHE size';            p{3,2}=50;         % CLAHE window size
p{4,1}= 'Highpass';              p{4,2}=0;          % 1 = enable highpass, 0 = disable
p{5,1}= 'Highpass size';         p{5,2}=15;         % highpass size
p{6,1}= 'Clipping';              p{6,2}=0;          % 1 = enable clipping, 0 = disable
p{7,1}= 'Wiener';                p{7,2}=0;          % 1 = enable Wiener2 adaptive denoise filter, 0 = disable
p{8,1}= 'Wiener size';           p{8,2}=3;          % Wiener2 window size
p{9,1}= 'Minimum intensity';     p{9,2}=0.0;        % Minimum intensity of input image (0 = no change)
p{10,1}='Maximum intensity';     p{10,2}=1.0;       % Maximum intensity on input image (1 = no change)
%%
%[text] ## Calibrate cameras
cam1_files = dir(fullfile(calibration_dir, ['CAM1*A.', image_ext]));
cam2_files = dir(fullfile(calibration_dir, ['CAM2*A.', image_ext]));
image_indices = [5,7,14,15,19,25,30,40,51,64];
cam1_files = cam1_files(image_indices);
cam2_files = cam2_files(image_indices);
cam1_files = strcat({cam1_files.folder}', filesep, {cam1_files.name}');
cam2_files = strcat({cam2_files.folder}', filesep, {cam2_files.name}');
image_size = size(imread(cam1_files{1}));

worldPoints = patternWorldPoints(pattern_type, pattern_dims, checker_size);
stereo_image_points = detectCharucoBoardPoints(cam1_files, cam2_files, pattern_dims, pattern_name, checker_size, marker_size);
stereo_parameters = estimateCameraParameters(stereo_image_points, worldPoints, ImageSize=image_size);
%%
%[text] ## Get transforms to laser light plane
cam1_files = dir(fullfile(image_dir, filesep, ['CAM1*.', image_ext]));
cam2_files = dir(fullfile(image_dir, filesep, ['CAM2*.', image_ext]));
matchedPoints1 = {};
matchedPoints2 = {};
for indx = 1:6:length(cam1_files) %[output:group:48b40efc]
    img = imread(image_dir + filesep + cam1_files(indx).name);
    img1 = imgaussfilt(imflatfield(imadjust(img), 200), 5);
    features = detectMSERFeatures(img1, "ThresholdDelta", 10, RegionAreaRange=[800,1e6], MaxAreaVariation=40);
    %features = detectSURFFeatures(img);
    [f1, points_obj1] = extractFeatures(img1, features);

    img = imread(image_dir + filesep + cam2_files(indx).name);
    img2 = imgaussfilt(imflatfield(imadjust(img), 200), 5);
    features = detectMSERFeatures(img2, "ThresholdDelta", 10, RegionAreaRange=[800,1e6], MaxAreaVariation=40);
    %features = detectSURFFeatures(img);
    [f2, points_obj2] = extractFeatures(img2, features);
    
    indexPairs = matchFeatures(f1, f2, MatchThreshold=2, Unique=true); % MaxRatio=0.5);
    if size(indexPairs,1) > 0
        disp(cam1_files(indx).name) %[output:7d96bdd1]
        i1 = img1; i2 = img2;
        showMatchedFeatures(i1, i2, points_obj1(indexPairs(:,1)), points_obj2(indexPairs(:,2)), 'montage'); %[output:99092bb8]
    end
    matchedPoints1{end+1} = points_obj1(indexPairs(:,1));
    matchedPoints2{end+1} = points_obj2(indexPairs(:,2));
end %[output:group:48b40efc]

matchedPoints1 = vertcat(matchedPoints1{:});
matchedPoints2 = vertcat(matchedPoints2{:});

% Running this twice clears out points that might not lie in the plane!
[~,is_inlier,~] = estimateFundamentalMatrix(matchedPoints1.Location, matchedPoints2.Location);
matchedPoints1 = matchedPoints1(is_inlier);
matchedPoints2 = matchedPoints2(is_inlier);

[~,is_inlier,~] = estimateFundamentalMatrix(matchedPoints1.Location, matchedPoints2.Location);
matchedPoints1 = matchedPoints1(is_inlier);
matchedPoints2 = matchedPoints2(is_inlier);

p = triangulate(matchedPoints1.Location, matchedPoints2.Location, stereo_parameters);
mu = mean(p, 1); % Find the centroid of the points
[~,~,V] = svd(p - mu); % The last column of V (the vector corresponding to the smallest SV) is the unit normal to the plane
normal = V(:,end)';
%%
figure %[output:120a9d51]
hold on %[output:120a9d51]
showExtrinsics(stereo_parameters) %[output:120a9d51]
scatter3(p(:,1), p(:,3), p(:,2)) %[output:120a9d51]
quiver3(mu(1),mu(3),mu(2), normal(1), normal(3), normal(2), 100) %[output:120a9d51]
hold off %[output:120a9d51]
%%
reflection = @(u,n) u - 2 * n' * (n*u) / (n*n');
S = reflection(eye(3), normal + [0,0,1]);      % S*u = -v, S*v = -u 
R1 = reflection( S, normal); 
rt1 = rigidtform3d(R1, mu);

[a,b,c] = transformPointsInverse(rt1, p(:,1), p(:,2), p(:,3));  % [a,b] are the 2d world points in real units (c ~= 0)

tform1 = fitgeotform2d(matchedPoints1.Location, [a,b],"projective");
tform2 = fitgeotform2d(matchedPoints2.Location, [a,b],"projective");
%%
%[text] ## Create list of images inside user specified directory
files = dir(fullfile(image_dir, ['*.', image_ext]));
filenames = string({files.name})';
filenames = sortrows(filenames); %sort all image files
%%
%[text] ## PIV analysis loop
if pairwise == 1
	if mod(length(filenames), 2) == 1 % Uneven number of images?
		disp('Image folder should contain an even number of images.')
		% remove last image from list
		filenames(end) = [];
	end
    amount = length(filenames);
	disp(['Found ' num2str(amount) ' images (' num2str(amount/2) ' image pairs).'])
	x = cell(amount/2, 1);

else
    amount = length(filenames);
	disp(['Found ' num2str(amount) ' images'])
	x = cell(amount-1,1);
end
y = x;
u = x;
v = x;
typevector = x; % typevector will be 1 for regular vectors, 0 for masked areas
correlation_map = x; % correlation coefficient
%%
%[text] ## Pre-load the image names out side of the parallelizable loop
filenames = reshape(filenames', 2, [])';
slicedfilename1 = cellstr(filenames(:,1));
slicedfilename2 = cellstr(filenames(:,2));
%%

%%

%%
%[text] ## Main PIV analysis loop:
%[text] Parallel processing or...
if nr_of_cores > 1
    try
		local_cluster = parcluster('local'); % single node
		corenum = local_cluster.NumWorkers ; % fix : get the number of cores available
	catch
		warning('on');
		warning('parallel local cluster can not be created, assigning number of cores to 1');
		nr_of_cores = 1;
    end
end
if nr_of_cores > 1
	if misc.pivparpool('size') < nr_of_cores
		misc.pivparpool('open', nr_of_cores);
	end

	parfor i = 1:size(slicedfilename1,2)  % index must increment by 1

		[x{i}, y{i}, u{i}, v{i}, typevector{i},correlation_map{i}] = ...
			piv.piv_analysis(directory, slicedfilename1{i}, slicedfilename2{i},p,s,nr_of_cores,false);
	end
%[text] ... Sequential loop
else % sequential loop

	for i=1:size(slicedfilename1,2)  % index must increment by 1

		[x{i}, y{i}, u{i}, v{i}, typevector{i},correlation_map{i}] = ...
			piv.piv_analysis(directory, slicedfilename1{i}, slicedfilename2{i},p,s,nr_of_cores,true);

		disp([int2str((i+1)/amount*100) ' %']);

	end
end

%[text] The most important results are x,y,u,v. These can now be viewed before validation:
figure;quiver(x{1},y{1},u{1},v{1},5);axis image;  %(the last number determines the displayed sclae of the vectors)
title('Raw results of first image pair')
%%
%[text] ## PIV postprocessing loop
%[text] Standard image post processing settings
r = cell(6,1);
%Parameter     %Setting                                     %Options
r{1,1}= 'Calibration factor, 1 for uncalibrated data';      r{1,2}=1;                   % Calibration factor for u
r{2,1}= 'Calibration factor, 1 for uncalibrated data';      r{2,2}=1;                   % Calibration factor for v
r{3,1}= 'Valid velocities [u_min; u_max; v_min; v_max]';    r{3,2}=[-50; 50; -50; 50];  % Maximum allowed velocities, for uncalibrated data: maximum displacement in pixels
r{4,1}= 'Stdev check?';                                     r{4,2}=1;                   % 1 = enable global standard deviation test
r{5,1}= 'Stdev threshold';                                  r{5,2}=7;                   % Threshold for the stdev test
r{6,1}= 'Local median check?';                              r{6,2}=1;                   % 1 = enable local median test
r{7,1}= 'Local median threshold';                           r{7,2}=3;                   % Threshold for the local median test

u_filt=cell(size(u));
v_filt=cell(size(v));
typevector_filt=typevector;

if nr_of_cores >1 % parallel loop

	if misc.pivparpool('size')<nr_of_cores
		misc.pivparpool('open',nr_of_cores);
	end

	parfor PIVresult=1:size(x,1)

		[u_filt{PIVresult,1}, v_filt{PIVresult,1},typevector_filt{PIVresult,1}]= ...
			post_proc_wrapper(u{PIVresult,1},v{PIVresult,1},typevector{PIVresult,1},r,true);

	end

else % sequential loop

	for PIVresult=1:size(x,1)

		[u_filt{PIVresult,1}, v_filt{PIVresult,1},typevector_filt{PIVresult,1}]= ...
			post_proc_wrapper(u{PIVresult,1},v{PIVresult,1},typevector{PIVresult,1},r,true);

	end

end
%[text] Post-processing finished, here are the filtered results:
figure;quiver(x{1},y{1},u_filt{1},v_filt{1},5);axis image; %(the last number determines the displayed sclae of the vectors)
title('Filtered results of first image pair')
%%
%[text] ## clean up parallel pool, and cluster (if required, will save RAM)
%{
if nr_of_cores >1 % parallel
	poolobj = gcp('nocreate'); % GET the current parallel pool
	if ~isempty(poolobj ); delete(poolobj );end
	clear local_cluster;
end
%}
%%
%[text] Save the data to a Matlab file
save(fullfile(directory, [filenames{1} '_' filenames{end} '_' num2str(amount) '_frames_result_.mat']));
%%
%[text] Clean up unused vars
clearvars -except p s r x y u v typevector directory filenames u_filt v_filt typevector_filt correlation_map
disp('DONE.')

%%
%[text] Wrapper function for PIVlab\_postproc
function [u_filt, v_filt,typevector_filt] = post_proc_wrapper(u,v,typevector,post_proc_setting,paint_nan)
% wrapper function for postproc.PIVlab_postproc

% INPUT
% u, v: u and v components of vector fields
% typevector: type vector
% post_proc_setting: post processing setting
% paint_nan: bool, whether to interpolate missing data

% OUTPUT
% u_filt, v_filt: post-processed u and v components of vector fields
% typevector_filt: post-processed type vector


[u_filt,v_filt] = postproc.PIVlab_postproc(u,v, ...
	post_proc_setting{1,2},...
	post_proc_setting{2,2},...
	post_proc_setting{3,2},...
	post_proc_setting{4,2},...
	post_proc_setting{5,2},...
	post_proc_setting{6,2},...
	post_proc_setting{7,2});

typevector_filt = typevector; % initiate
typevector_filt(isnan(u_filt))=2;
typevector_filt(isnan(v_filt))=2;
typevector_filt(typevector==0)=0; %restores typevector for mask

if paint_nan
	u_filt=misc.inpaint_nans(u_filt,4);
	v_filt=misc.inpaint_nans(v_filt,4);
end


end

